import { Link } from "react-router-dom";
import("./Directory.scss");

const Directory = () => {
    const [pets, setPets] = useState([]);

    useEffect(() => {
        const makeAPICall = async () => {
            const response = await fetch(`${APIURL}/availablePets`);

            const data = await response.json();
            console.log("data", data);
            setPets(data.availablePets);
        };
        makeAPICall();
    }, []);
    const searchPets = async (event) => {
        event.preventDefault();

        const response = await fetch(`${APIURL}/petsSearch`, {
            headers: {
                "Content-Type": "application/json",
            },
            body: JSON.stringify({
                query: event.target.elements.searchInput.value,
            }),
            method: "POST",
        });

        const data = await response.json();
        setPets(data.Pets);
    };
    return (
        <div>
            <div className="container-fluid" id="Directory">
                <div className="row">
                    <div className="col-8">
                        <h1>
                            <Link to="/">Find Your Furever Friend</Link>
                        </h1>
                    </div>
                    {/* <!-- end of Find col --> */}
                    <div className="col-2">
                        <h6>
                            <Link to="/CreateShelterAccount">
                                Create Account
                            </Link>
                        </h6>
                    </div>
                    {/* <!-- end of adopters col --> */}
                    <div className="col-2">
                        <h6>
                            {" "}
                            <Link to="/ShelterSignin">Signin</Link>{" "}
                        </h6>
                    </div>
                    {/* <!-- end of shelters col --> */}
                </div>
                {/* <!-- end of row 1 --> */}
                <div className="row" id="col-names">
                    <div className="col-3">
                        <h5>Shelter Name</h5>
                    </div>
                    <div className="col-3">
                        <h5>Phone Number</h5>
                    </div>
                    <div className="col-3">
                        <h5>Address</h5>
                    </div>
                </div>
                <hr />
                <div className="row">
                    <div className="col-3">
                        <h6 id="name">Pawsitivitea CNY Cafe & Cat Lounge</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-807-8936</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            2100 Park St <br />
                            Syracuse, NY 13208
                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                </div>
                {/* <!-- end of row 2 --> */}
                <div className="row">
                    <div className="col-3">
                        <h6 id="name">Helping Hounds Dog Rescue</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-446-5970</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            7268 Caswell Ave <br />
                            North Syracuse, NY 13212
                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                </div>
                {/* <!-- end of row 3 --> */}
                <div className="row">
                    <div className="col-3">
                        <h6 id="name">Second Chance Canine Adoption</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="phoneNumber">315-435-5584</h6>
                    </div>
                    <div className="col-3">
                        <h6 id="address">
                            6660 E Seneca Turnpike <br />
                            Jamesville, NY 13078
                        </h6>
                    </div>
                    <div className="col-3">
                        <button type="button">
                            <Link to="/CreateShelterAccount">
                                Claim Your Business
                            </Link>
                        </button>
                    </div>
                    {/* <!-- end of row 4 --> */}
                </div>
                {/* <!-- end of container-fluid --></div> */}
            </div>
        </div>
    );
};

export default Directory;
